    font-weight: 800;
    font-size: 18px;

}
.Records-opinion {
	//color: white;
	font-weight: 800;
	display: inline-block;
	vertical-align: top;
	padding-top: 8px;
	margin-left: 3px;
}
.Records-opinion.is-for {
	color: #3EA869;
}
.Records-opinion.is-against {
	color: #C62F20;
}
.Records-opinion.is-unclear {
	background: gray;
}
.Records-voteNumbers.is-for {
	background: #3EA869;
	color: white;
	border-radius: 50%;

}
.Records-voteNumbers.is-against {
	background: #C62F20;
	color: white;
	border-radius: 50%;

}
.Records-voteNumbers.is-unclear {
	background: gray;
	color: white;
	border-radius: 50%;

}
.Records-quote {
	font-family: Georgia;
    margin: 4px 5px;
    padding: 4px 10px;
    quotes: "\201C""\201D""\2018""\2019";
}
.Records-quote:before {
	color: #ccc;
    content: open-quote;
    font-size: 4em;
    line-height: 0.1em;
    margin-right: 0.25em;
    vertical-align: -0.4em;
}
.Records-info {
	padding: 10px 20px;
	color: gray;
	font-size: 14px;
}
.Records-action {
	border-top: 1px dotted rgb(220,220,220);
}
.Records-actionItem {
	padding: 10px 20px;
	color: gray;
	font-size: 14px;
	display: inline-block;
}
.Records-star, .Records-more {
	cursor: pointer;
	font-weight: 800;
	color: rgb(220,220,220);
}
.Records-star:hover {
    color: #ffcc33;
}
.Records-more, .Records-more:visited {
    color: rgb(220,220,220);
	text-decoration: none;
}
.Records-more:hover {
    color: #038543;
}

.Records-tab {
	display: inline-block;
	margin: 4px;
	padding: 4px 6px;
	cursor: pointer;
}
.Records-tab.is-active {
	border-bottom: 3px solid #6FB3B1
}




